import './Schedule.css'

const Schedule = () => {
    const headersh = ["Hour", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday", "Sunday"]
    const hourto12 = (num) => ( (num % 12 || 12) + ':00 ' + num >= 12 ? 'p. m.' : 'a. m.' )
    return (
        <table className='schedule'>
            <tr>
                <th className='scheduleTitle'>Horario</th>
            </tr>
            <tr>
                {headersh.map(header => <th className='headersh'>{header}</th>)}
            </tr>
            {
                (() => {
                    let tags = []
                    for (let i = 0; i<15; i++)
                    {
                        tags.push(<th className='headersv'>{hourto12(i+7)}</th>)
                        for (let j = 0; j<8; j++) {
                            if (i <= 1 || j === 0)
                            {
                                tags.push(<div className='cell ext'></div>)
                            }
                            else {
                            tags.push(<div className='cell' id={(i-2)+'-'+(j-1)}></div>)
                            }
                        }
                    }
                    return tags
                })()
            }
        </table>
    )



}

export default Schedule
